import React from 'react'
import {Switch, Route} from 'react-router-dom'

const Routes = () => {
  return (
      <Switch>
        <Route exact path=''></Route>
      </Switch>
    )
}

export default Routes

// Switch : Component used to combine (wrap) all the routes
